import "./Productkaarten.css";

const ProductKaarten = ({name,image, prijs,subjet}) => {
    return(
        <article>
            <header>
                <h4>{name}</h4>
                <figure>
                    <img src={iamge} alt="" />
                </figure>
            </header>
            <section>
                <p></p>
            </section>
        </article>
    )
}

export default ProductKaarten;
